  `approve_by` varchar(45) DEFAULT NULL COMMENT '审批人',
  `approve_date` datetime DEFAULT NULL COMMENT '审批时间',
  `status` tinyint(4) DEFAULT NULL COMMENT '合同状态 0：未提交 1：待审核  2：审核驳回3 ：待确认 4：确认驳回 5：待生效 6：协议生效 7：需要审批  8：协议生效（正在修改） 9：协议过期 10：协议终止',
  `create_role` int(11) DEFAULT NULL COMMENT '创建者角色（卖0、买1）',
