  `active_flag` tinyint(4) DEFAULT NULL COMMENT '有效标记 0-有效 1-无效',
  `annex` varchar(256) DEFAULT NULL COMMENT '上传附件链接地址',
  `refusal_reason` varchar(200) DEFAULT NULL COMMENT '拒绝原因',
  `updated_contract_no` varchar(75) DEFAULT NULL COMMENT '协议生效修改后的协议关联字段',
  `contract_type` tinyint(4) DEFAULT NULL COMMENT '协议类型 1 单价  2  数量  3  总价值',
  `item_quantity` int(11) DEFAULT NULL COMMENT '协议数量',
  `contract_total` double DEFAULT NULL COMMENT '协议总价',
