  `Alternate_field6` varchar(100) DEFAULT NULL COMMENT '备用字段6',
  `contract_order_no` varchar(75) DEFAULT NULL COMMENT '所签协议序号',
  `old_file_name` varchar(255) DEFAULT NULL COMMENT '附件的原文件名',
  PRIMARY KEY (`id`),
  KEY `contract_no_UNIQUE` (`contract_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

