/*Table structure for table `item` */

DROP TABLE IF EXISTS `item`;

CREATE TABLE `item` (
  `item_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `item_name` varchar(200) DEFAULT NULL COMMENT '商品名称',
  `cid` bigint(20) DEFAULT NULL COMMENT '类目ID',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '商家ID',
  `item_status` int(4) DEFAULT NULL COMMENT '商品状态,1:未发布，2：待审核，20：审核驳回，3：待上架，4：在售，5：已下架，6：锁定， 7： 申请解锁,20:审核驳回，30已删除',
  `attributes` varchar(1100) DEFAULT NULL COMMENT '商品类目属性keyId:valueId',
  `attr_sale` varchar(1100) DEFAULT NULL COMMENT '商品销售属性keyId:valueId',
  `created` datetime DEFAULT NULL COMMENT '创建日期',
  `modified` datetime DEFAULT NULL COMMENT '修改日期',
  `shop_cid` bigint(20) DEFAULT NULL COMMENT '商品所属店铺类目id',
  `brand` bigint(20) DEFAULT NULL COMMENT '品牌',
  `market_price` decimal(14,2) DEFAULT NULL COMMENT '市场价',
  `market_price2` decimal(14,2) DEFAULT NULL COMMENT '成本价',
  `inventory` int(10) DEFAULT NULL COMMENT '库存量',
  `weight` decimal(11,2) DEFAULT NULL COMMENT '商品毛重',
  `weight_unit` varchar(10) DEFAULT NULL COMMENT '商品货号',
  `product_id` bigint(20) DEFAULT NULL COMMENT '商品描述url，存在jfs中',
  `describe_url` longtext COMMENT '商品描述',
  `packing_list` varchar(800) DEFAULT NULL COMMENT '包装清单',
  `after_service` varchar(1500) DEFAULT NULL COMMENT '售后服务',
  `ad` varchar(200) DEFAULT NULL COMMENT '广告词',
  `timing_listing` datetime DEFAULT NULL COMMENT '定时上架，为空则表示未设置定时上架',
  `listting_time` datetime DEFAULT NULL COMMENT '上架时间',
  `delisting_time` datetime DEFAULT NULL COMMENT '下架时间',
  `operator` int(4) DEFAULT NULL COMMENT '操作方，1：商家，2：平台',
  `status_change_reason` varchar(200) DEFAULT NULL COMMENT '平台方下架或锁定或审核驳回时给出的理由',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `guide_price` decimal(14,2) DEFAULT NULL COMMENT '商城指导价',
  `origin` varchar(100) DEFAULT NULL COMMENT '商品产地',
  `add_source` int(4) DEFAULT NULL COMMENT '来源：1自定义添加2：从平台商品库选择',
  `plat_link_status` int(4) DEFAULT NULL COMMENT '与平台商品库关联状态：1：未符合待入库2：待入库3：已入库4：删除',
  `has_price` int(4) DEFAULT NULL COMMENT '是否有报价：1：有价格；2：暂无报价',
  `plst_item_id` bigint(20) DEFAULT NULL COMMENT '平台商品ID，只有add_source为2时值才有意义',
  `keywords` varchar(1500) DEFAULT NULL COMMENT '关键字',
  `copied` int(2) DEFAULT '1' COMMENT '1 未加入商品库 2 已加入平台商品库',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '平台ID',
  `authentication` longtext COMMENT '认证信息',
  `shop_freight_template_id` bigint(20) DEFAULT NULL COMMENT '运费模版ID',
  `volume` decimal(14,2) DEFAULT NULL COMMENT '商品体积',
  PRIMARY KEY (`item_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000000023 DEFAULT CHARSET=utf8;

