  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modifid` datetime DEFAULT NULL COMMENT '修改时间',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  PRIMARY KEY (`seller_attrid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='�̼����Թ�����';

