/*Table structure for table `item_sales_volume` */

DROP TABLE IF EXISTS `item_sales_volume`;

CREATE TABLE `item_sales_volume` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `item_id` bigint(20) DEFAULT NULL COMMENT '商品id',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'sku id',
  `sales_volume` bigint(20) DEFAULT NULL COMMENT '销量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5277 DEFAULT CHARSET=utf8;

