/*Table structure for table `item_section` */

DROP TABLE IF EXISTS `item_section`;

CREATE TABLE `item_section` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `itemId` bigint(20) NOT NULL COMMENT '商品主键id',
  `market_price_start` decimal(14,2) DEFAULT NULL COMMENT '市场指导价最小价',
  `market_price_end` decimal(14,2) DEFAULT NULL COMMENT '市场指导价最大价钱',
  `base_price_start` decimal(14,2) DEFAULT NULL COMMENT '最小底价',
  `base_price_end` decimal(14,2) DEFAULT NULL COMMENT '最大底价',
  `quoted_price_start` decimal(14,2) DEFAULT NULL COMMENT '报价最小价钱',
  `quoted_price_end` decimal(14,2) DEFAULT NULL COMMENT '报价最大价钱',
  `weight_start` decimal(11,2) DEFAULT NULL COMMENT '商品重量最小重量',
  `weight_end` decimal(11,2) DEFAULT NULL COMMENT '商品最大重量',
  `volume_start` decimal(14,2) DEFAULT NULL COMMENT '商品最小体积',
  `volume_end` decimal(14,2) DEFAULT NULL COMMENT '商品最大体积',
  `interval_type` varchar(10) NOT NULL COMMENT '商品是否有区间标示。\r\n1，第一位为市场价，0代表不是区间，1代表有区间。\r\n2，第二位为底价价，0代表不是区间，1代表有区间。\r\n3，第三位为报价，0代表不是区间，1代表有区间。\r\n4，第四位为质量，0代表不是区间，1代表有区间。\r\n5，第五位为体积，0代表不是区间，1代表有区间。\r\n其余留作备用',
  `create_by` varchar(45) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(45) DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=90 DEFAULT CHARSET=utf8 COMMENT='主要用于添加商品时候，spu中不同sku，有区间要求。';

