/*Table structure for table `item_sku_inquiry_price` */

DROP TABLE IF EXISTS `item_sku_inquiry_price`;

CREATE TABLE `item_sku_inquiry_price` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `buyer_id` bigint(20) DEFAULT NULL COMMENT '买家ID',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家ID',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `item_id` bigint(20) DEFAULT NULL COMMENT '商品ID',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'SKU id',
  `inquiry_qty` int(10) DEFAULT NULL COMMENT '询价数量',
  `inquiry_price` decimal(14,2) DEFAULT NULL COMMENT '价格',
  `inquiry_remark` varchar(500) DEFAULT NULL COMMENT '卖家备注',
  `start_time` datetime DEFAULT NULL COMMENT '价格执行开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '价格执行结束时间',
  `comment` varchar(500) DEFAULT NULL COMMENT '备注',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '结束时间',
  `email` varchar(200) DEFAULT NULL COMMENT '邮箱',
  `cellphone` varchar(11) DEFAULT NULL COMMENT '手机',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='��ƷSKUѯ��';

