/*Table structure for table `item_sku_picture` */

DROP TABLE IF EXISTS `item_sku_picture`;

CREATE TABLE `item_sku_picture` (
  `picture_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '图片id',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'sku id',
  `picture_url` varchar(512) DEFAULT NULL COMMENT '图片url',
  `sort_number` tinyint(11) DEFAULT NULL COMMENT '排序号,排序号最小的作为主图，从1开始',
  `picture_status` tinyint(4) DEFAULT NULL COMMENT '图片状态:1 有效 2： 无效',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `created` datetime DEFAULT NULL COMMENT '创建日期',
  `modified` datetime DEFAULT NULL COMMENT '修改日期',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  PRIMARY KEY (`picture_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3886 DEFAULT CHARSET=utf8 COMMENT='��ƷskuͼƬ';

