/*Table structure for table `sku_point_rate` */

DROP TABLE IF EXISTS `sku_point_rate`;

CREATE TABLE `sku_point_rate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sku_id` bigint(20) NOT NULL,
  `rate` tinyint(4) NOT NULL COMMENT '每一元兑换的积分数',
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  `is_del` tinyint(4) DEFAULT '1' COMMENT '删除标志位（1：未删除，2：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

