/*Table structure for table `translation_info` */

DROP TABLE IF EXISTS `translation_info`;

CREATE TABLE `translation_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `translation_no` varchar(75) DEFAULT NULL COMMENT '求购编号',
  `translation_name` varchar(45) DEFAULT NULL COMMENT '求购名称',
  `printer_id` int(11) DEFAULT NULL COMMENT '印刷厂主键',
  `supplier_id` int(11) DEFAULT NULL COMMENT '供货方主键',
  `begin_date` datetime DEFAULT NULL COMMENT '询价有效期--开始',
  `end_date` datetime DEFAULT NULL COMMENT '询价有效期--结束',
  `mat_cd` varchar(45) DEFAULT NULL COMMENT '物料号',
  `mat_attribute` varchar(200) DEFAULT NULL COMMENT '物品属性',
  `quantity` int(11) DEFAULT NULL COMMENT '数量',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态',
  `delivery_date` datetime DEFAULT NULL COMMENT '交货时间',
  `category_id` int(11) DEFAULT NULL COMMENT '类目id',
  `annex` varchar(300) DEFAULT NULL COMMENT '附件',
  `remarks` varchar(300) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(45) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(45) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `active_flag` tinyint(4) DEFAULT NULL COMMENT '有效标记 0-有效 1-无效',
  `refusal_reason` varchar(200) DEFAULT NULL COMMENT '拒绝原因',
  `alternate_field1` varchar(100) DEFAULT NULL COMMENT '备用字段1',
  `alternate_field2` varchar(100) DEFAULT NULL COMMENT '备用字段2',
  `alternate_field3` varchar(100) DEFAULT NULL COMMENT '备用字段3',
  `alternate_field4` varchar(100) DEFAULT NULL COMMENT '备用字段4',
  `alternate_field5` varchar(100) DEFAULT NULL COMMENT '备用字段5',
  `platform_id` int(11) DEFAULT NULL COMMENT '平台ID',
  `item_name` varchar(30) DEFAULT NULL COMMENT '商品名称',
  `old_file_name` varchar(255) DEFAULT NULL COMMENT '附件的原文件名',
  PRIMARY KEY (`id`),
  KEY `contract_no_UNIQUE` (`translation_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `translation_info` */

/*Table structure for table `translation_mat` */

DROP TABLE IF EXISTS `translation_mat`;

CREATE TABLE `translation_mat` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `translation_no` varchar(45) DEFAULT NULL COMMENT '求购号',
  `mat_cd` varchar(45) DEFAULT NULL COMMENT '物料号',
  `mat_desc` varchar(45) DEFAULT NULL COMMENT '物料描述',
  `mat_attribute` varchar(200) DEFAULT NULL COMMENT '物品属性',
  `lable1_cd` varchar(45) DEFAULT NULL COMMENT '类别1',
  `lable1_desc` varchar(45) DEFAULT NULL COMMENT '类别1描述',
  `lable2_cd` varchar(45) DEFAULT NULL COMMENT '类别2',
  `lable2_desc` varchar(45) DEFAULT NULL COMMENT '类别2描述',
  `lable3_cd` varchar(45) DEFAULT NULL COMMENT '类别3',
  `lable3_desc` varchar(45) DEFAULT NULL COMMENT '类别3描述',
  `mat_spec` varchar(45) DEFAULT NULL COMMENT '物料规格',
  `mat_brand` varchar(45) DEFAULT NULL COMMENT '品牌',
  `mat_discount` varchar(45) DEFAULT NULL COMMENT '折扣',
  `mat_price` double DEFAULT NULL COMMENT '价格',
  `mat_unit` varchar(45) DEFAULT NULL COMMENT '单位',
  `category_id` int(11) DEFAULT NULL COMMENT '类目id',
  `begin_date` datetime DEFAULT NULL COMMENT '有效期--开始',
  `end_date` datetime DEFAULT NULL COMMENT '有效期--结束',
  `printer_id` int(11) DEFAULT NULL COMMENT '印刷厂主键',
  `supplier_id` int(11) DEFAULT NULL COMMENT '供货方主键',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `create_by` varchar(45) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建日期',
  `update_by` varchar(45) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `status` int(11) DEFAULT NULL COMMENT '状态 null：未接收，1已接受',
