/* Function  structure for function  `get_item_id` */

/*!50003 DROP FUNCTION IF EXISTS `get_item_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `get_item_id`() RETURNS varchar(13) CHARSET utf8
BEGIN
	DECLARE id VARCHAR(13);
	DECLARE seq_val BIGINT(10);
	SELECT seq_nextval('item_id') INTO seq_val;
	SELECT CONCAT('1',LPAD(CONVERT(seq_val,CHAR),9,'0')) INTO id;
	RETURN id;
    END */$$
DELIMITER ;

