/* Function  structure for function  `get_order_no` */

/*!50003 DROP FUNCTION IF EXISTS `get_order_no` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `get_order_no`() RETURNS varchar(13) CHARSET utf8
BEGIN
	DECLARE order_no VARCHAR(13);
	DECLARE date_str VARCHAR(8);
	DECLARE seq_val BIGINT(10);
	SELECT DATE_FORMAT(NOW(),'%Y%m%d') INTO date_str;
	SELECT seq_nextval('trade_orders_id') INTO seq_val;
	SELECT CONCAT(date_str,LPAD(CONVERT(seq_val,CHAR),5,'0')) INTO order_no;
	RETURN order_no;
    END */$$
DELIMITER ;

/* Function  structure for function  `queryChildCategory` */

/*!50003 DROP FUNCTION IF EXISTS `queryChildCategory` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `queryChildCategory`(pid INT) RETURNS varchar(4000) CHARSET utf8
BEGIN
	DECLARE sTemp VARCHAR(4000);
	DECLARE sTempChd VARCHAR(4000);
	SET sTempChd = CAST(pid AS CHAR);
	WHILE sTempChd IS NOT NULL DO
		IF(sTemp IS NOT NULL ) THEN 
			SET sTemp = CONCAT(sTemp,',',sTempChd);
		ELSE 
			SET sTemp = CONCAT(sTempChd);
		END IF;
		SELECT GROUP_CONCAT(cid) INTO sTempChd FROM item_category WHERE FIND_IN_SET(parent_cid,sTempChd)>0;
	END WHILE;
RETURN sTemp;
END */$$
DELIMITER ;

/* Function  structure for function  `seq_currval` */

/*!50003 DROP FUNCTION IF EXISTS `seq_currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `seq_currval`(sequence_name VARCHAR(50)) RETURNS bigint(10)
BEGIN
	DECLARE cvalue INTEGER;  
	SELECT current_value INTO cvalue  
	FROM sequence  
	WHERE seq_name = sequence_name;  
	RETURN cvalue;
    END */$$
DELIMITER ;

/* Function  structure for function  `seq_nextval` */

/*!50003 DROP FUNCTION IF EXISTS `seq_nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `seq_nextval`(sequence_name VARCHAR(50)) RETURNS bigint(10)
BEGIN
	UPDATE sequence  
	SET sequence.current_value = sequence.current_value + sequence.increment  
	WHERE sequence.seq_name = sequence_name;
	RETURN seq_currval(sequence_name);
    END */$$
DELIMITER ;

